import { Injectable } from '@angular/core';
import {Recipe} from "./recipe.model";

@Injectable({
  providedIn: 'root'
})
export class RecipeService {
  private recipes: Recipe[] = [
    new Recipe('A Test Recipe','This is Test','data:image/jpeg;base64,'),
    new Recipe('Another Test Recipe','This is Test','data:image/jpeg;base64,')
  ];
  constructor() { }

  getRecipes(){
    return this.recipes.slice();
  }
}
